import React, { useState } from "react";
import Logo from '../assets/logo.png'
import '.App.'

const BasicSidebar = () => {
return (
    <div className="Sidebar">
     {/* logo */}
    <div className="logo">
        <img src={Logo} alt="tenOhseven" />    
    </div>

    {/* menu */}
    <div className="menu">
        <div className="menuItem">
            <div>Icon</div>
            <span>Landing</span>
        </div>
        </div>
        </div>
)
}

export default BasicSidebar;
